American Daydreams - Priya Rai
Added: March 25, 2011

Christian comes home from a long hard day at the office. He steps into the front door and is greeted by silence. He heads to the kitchen and his wife Priya is busy working on some documents. She is drinking a beer and tells him to go get his own out of the fridge. He inquires about dinner, and she throws a TV Dinner at him. Disappointed, he stares at the ceiling and dreams about a different scenario - where his wife greets him at the door, gives him a big kiss, takes his briefcase and jacket, sits him down in the kitchen, brings him a cold beer, has a nice steak dinner cooked for him.......and then after he is done eating, is waiting in their bed with some sexy lingerie and wants to fuck. What a story!
